/*Table structure for table `area` */

DROP TABLE IF EXISTS `area`;

CREATE TABLE `area` (
  `IDAREA` int(2) unsigned zerofill NOT NULL AUTO_INCREMENT,
  `NOMBRE_AREA` char(50) COLLATE utf8_spanish2_ci NOT NULL,
  `ESTADO` char(1) COLLATE utf8_spanish2_ci NOT NULL DEFAULT '1' COMMENT '1 ACTIVO / 0 INACTIVO',
  `DESCRIPCION` mediumtext COLLATE utf8_spanish2_ci,
  PRIMARY KEY (`IDAREA`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish2_ci;

/*Data for the table `area` */

insert  into `area`(`IDAREA`,`NOMBRE_AREA`,`ESTADO`,`DESCRIPCION`) values (01,'ADMINISTRACION','1',NULL),(02,'RECURSOS HUMANOS','1',NULL),(03,'ASESORIA JURIDICA','1',NULL),(04,'GESTION DE LA EDUCACION BASICA REGULAR Y ESPECIAL','1',NULL),(05,'GESTION DE LA EDUCACION BASICA ALTERNATIVA Y TECNI','1',NULL),(06,'PLANIFICACION Y PRESUPUESTO','1',NULL),(07,'SUPERVISION Y GESTION DEL SERVICIO EDUCATIVO','1',NULL),(08,'DIRECCION','1',NULL);

/*Table structure for table `bitacora_activo` */

DROP TABLE IF EXISTS `bitacora_activo`;

CREATE TABLE `bitacora_activo` (
  `IDBITACORA` int(5) unsigned zerofill NOT NULL AUTO_INCREMENT,
  `IDACTIVO` int(4) unsigned zerofill NOT NULL,
  `IDCOMPONENTE` int(2) unsigned zerofill NOT NULL,
  `IDINVENTARIO` int(3) unsigned zerofill NOT NULL,
  `TIPOACTA` char(3) COLLATE utf8_spanish2_ci NOT NULL COMMENT 'ENT ENTRGA / RET RETIRO',
  `IDPERSONA` int(4) unsigned zerofill NOT NULL,
  `IDUSUARIOCREACION` char(30) COLLATE utf8_spanish2_ci NOT NULL,
  `FECHACREACION` datetime NOT NULL,
  `ESTADO_ACTIVO` char(1) COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT '1 ACTIVO, 2 DAÑADO, 0 OBSOLETO, 3 CADUCADO, 4 DONACION, 5 PERDIDO',
  `DESCRIPCION` char(50) COLLATE utf8_spanish2_ci DEFAULT NULL,
  PRIMARY KEY (`IDBITACORA`),
  KEY `fk_idactivo` (`IDACTIVO`)
