/*Table structure for table `seguridad_modulo` */

DROP TABLE IF EXISTS `seguridad_modulo`;

CREATE TABLE `seguridad_modulo` (
  `IDMODULO` int(2) NOT NULL AUTO_INCREMENT,
  `NOMBRE_MODULO` char(30) CHARACTER SET utf8 COLLATE utf8_spanish_ci NOT NULL,
  `DESCRIPCION` char(50) CHARACTER SET utf8 COLLATE utf8_spanish_ci NOT NULL,
  `TIPO` char(20) CHARACTER SET utf8 COLLATE utf8_spanish_ci NOT NULL,
  `UBICACION` char(50) CHARACTER SET utf8 COLLATE utf8_spanish_ci NOT NULL,
  `ESTADO` char(1) CHARACTER SET utf8 COLLATE utf8_spanish_ci NOT NULL DEFAULT '1' COMMENT '1 -> ACTIVO / 0->INACTIVO',
  `FECHAMOD` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`IDMODULO`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish2_ci;

